import MenuItem from '../../components/menu-items/menu-item.component'
import './homepage.styles.scss'

const HomePage = () => {
    return (
        <div className='homepage'>
            <div className='directory-menu'>
               <MenuItem name = {'BADU'}/>
            </div>
        </div>
    )
}


export default HomePage;
